export const sensorData = [
    {
        id:0,
      name: 'Sensor 1',
      data: [
        { type: 'Temperature', value: 25, unit: '°C' },
        { type: 'Humidity', value: 50, unit: '%' },
        
      ],
    },
    {
        id:1,
      name: 'Sensor 2',
      data: [
        { type: 'Pressure', value: 1013, unit: 'hPa' },
        { type: 'Light', value: 500, unit: 'lux' },
        
      ],
    },
    
  ];
